claims:
1. An electrochemical cell for a secondary lithium ion battery, comprising:
      a negative electrode;
      a positive electrode spaced apart from the negative electrode;
      an electrolyte impregnating the anode and the cathode and disposed between opposing front surfaces of the anode and the cathode;
      a lithium ion transport channel extending through the anode, the cathode, and the electrolyte; and
      lithiated zeolite particles disposed along at least a portion of the lithium ion transport channels,
      wherein the electrolyte is a liquid electrolyte solution containing a lithium salt dissolved in a non-aqueous aprotic organic solvent, and the lithiated zeolite particles are suspended in or mixed with the liquid electrolyte solution, and
      wherein the lithiated zeolite particles comprise particles of a dehydrated zeolitic material having a Si to Al ratio greater than 5:1 and a framework type selected from the group consisting of ASV, BEA, CFI, CON, DDR, DOH, DON, ESV, EUO, FER, GON, IFR, ISV, ITE, LEV, MEL, MEP, MFI, MFS, MSO, MTF, MTN, MTT, MTW, MWW, NON, NES, RSN, RTE, RTH, RUT, SFE, SFF, SGT, SOD, STF, STT, TER, TON, VET, VNI, and VSV.
